import React from 'react';
import { motion } from 'framer-motion';
import { ArrowRight, MapPin, Zap, Globe } from 'lucide-react';
import './Portfolio.css';

const Portfolio = () => {
  const portfolioItems = [
    {
      type: "Solar Farms",
      title: "Karnataka Solar Complex",
      location: "Karnataka, India",
      capacity: "150 MW",
      description: "Large-scale solar farm providing clean energy to industrial consumers across Karnataka.",
      image: "https://images.unsplash.com/photo-1509391366360-2e959784a276?w=800&h=450&fit=crop",
      features: ["Grid Connected", "Industrial Supply", "24/7 Monitoring"]
    },
    {
      type: "Wind Farms",
      title: "Maharashtra Wind Project",
      location: "Maharashtra, India",
      capacity: "200 MW",
      description: "Wind energy project harnessing the power of coastal winds for sustainable electricity generation.",
      image: "https://images.unsplash.com/photo-1466611653911-95081537e5b7?w=800&h=450&fit=crop",
      features: ["Coastal Location", "High Efficiency", "Low Maintenance"]
    },
    {
      type: "Hybrid Farms",
      title: "Rajasthan Hybrid Complex",
      location: "Rajasthan, India",
      capacity: "300 MW",
      description: "Combined solar and wind energy complex maximizing renewable energy production throughout the year.",
      image: "https://images.unsplash.com/photo-1473341304170-971dccb5ac1e?w=800&h=450&fit=crop",
      features: ["Solar + Wind", "Year-round Power", "Optimal Location"]
    }
  ];

  return (
    <section className="portfolio">
      <div className="portfolio-container">
        <motion.div
          className="section-header"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <h2 className="section-title">
            Asset Portfolio and Management
          </h2>
          <h3 className="section-subtitle">
            Delivering Green power at scale with
          </h3>
        </motion.div>

        <motion.div
          className="portfolio-grid"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          viewport={{ once: true }}
        >
          {portfolioItems.map((item, index) => (
            <motion.div
              key={index}
              className="portfolio-card"
              initial={{ opacity: 0, scale: 0.8 }}
              whileInView={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ scale: 1.02 }}
            >
              <div className="portfolio-image">
                <img src={item.image} alt={item.title} />
                <div className="portfolio-overlay">
                  <div className="portfolio-type">{item.type}</div>
                </div>
              </div>
              
              <div className="portfolio-content">
                <h3 className="portfolio-title">{item.title}</h3>
                
                <div className="portfolio-meta">
                  <div className="meta-item">
                    <MapPin size={16} />
                    <span>{item.location}</span>
                  </div>
                  <div className="meta-item">
                    <Zap size={16} />
                    <span>{item.capacity}</span>
                  </div>
                </div>
                
                <p className="portfolio-description">{item.description}</p>
                
                <div className="portfolio-features">
                  {item.features.map((feature, featureIndex) => (
                    <span key={featureIndex} className="feature-tag">
                      {feature}
                    </span>
                  ))}
                </div>
                
                <a href="#contact" className="portfolio-link">
                  Learn More
                  <ArrowRight size={16} />
                </a>
              </div>
            </motion.div>
          ))}
        </motion.div>

        <motion.div
          className="portfolio-summary"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.4 }}
          viewport={{ once: true }}
        >
          <p>
            From Karnataka to Maharashtra, our renewable farms are built for the nation's climate-conscious corporates across industries. 
            Spanning over 10 states and backed by large scale solar, wind, and hybrid farms, our offsite open access network delivers 
            consistent green power to private C&I consumers across India. Seamless, tailor-made, scalable, and future-ready - just like 
            the businesses we power.
          </p>
        </motion.div>
      </div>
    </section>
  );
};

export default Portfolio;
